package br.poli.ecomp.geav.nhe.model.db.cmp;import br.poli.ecomp.geav.nhe.model.db.Table;import br.poli.ecomp.geav.nhe.model.db.pro.IProjeto;	public class Composicao extends Table implements IComposicao{	private int cmp_identificador;	private IProjeto pro_componente;	private IProjeto pro_projeto;	private int cmp_atual;		public Composicao()	{	}		@Override	public int get_cmp_atual() {		return this.cmp_atual;	}	@Override	public int get_cmp_identificador() {		return this.cmp_identificador;	}	@Override	public IProjeto get_pro_componente() {		return this.pro_componente;	}	@Override	public IProjeto get_pro_projeto() {		return this.pro_projeto;	}	@Override	public void set_cmp_atual(int value) {		this.cmp_atual = value;			}	@Override	public void set_cmp_identificador(int value) {		this.cmp_identificador = value;			}	@Override	public void set_pro_componente(IProjeto value) {		this.pro_componente = value;			}	@Override	public void set_pro_projeto(IProjeto value) {		this.pro_projeto = value;			}}
